import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六乙日癸未时断</p><p>六乙日生时癸未，入墓之中遇倒伤；</p><p>马劣财微食见克，一生衣禄主平常。</p><p>乙日癸未时，乙以癸为倒食，未中丁火食神，己土偏财，破癸癸倒未中丁火之食，平常衣禄。</p><p>通土气月则吉。</p><p>乙丑日癸未时，凶刑孤独，年月通土气，吉。</p><p>乙卯日癸未时，改祖离亲，就妻为家。</p><p>午未年月，贵。</p><p>春尤贵。</p><p>乙巳日癸未时，不贵则富，先难后易。</p><p>纯午、三品贵。</p><p>辰戌丑月，俱吉。</p><p>乙未日癸未时，春，身旺刑伤。</p><p>秋，官煞旺，科名有分。</p><p>冬安稳。</p><p>夏平常。</p><p>乙酉日癸未时，身坐煞，春，身旺，吉。</p><p>夏，身弱煞衰，贫。</p><p>秋，煞旺，身能从化，贵。</p><p>冬平。</p><p>辰戌丑未月，透庚辛，行金运，贵。</p><p>一到刃运，退官罢职。</p><p>乙亥日癸未时，春木旺，刑伤妻子。</p><p>申月官旺，贵。</p><p>酉煞旺，年月有火则吉。</p><p>午未戌年月，一二品贵。</p><p>冬生稳厚。</p><p>乙日相逢时癸未，算来离祖不成家；有刑克害多成败，运吉如添锦上花。</p><p>乙日相逢癸未，生逢木墓夭孤。</p><p>雁行兄弟有如无，心性不常喜怒。</p><p>自立自成事业，六亲骨肉亲疏，贵人得合两相扶，此命先贫后富。</p>",31),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","187卷 八·六乙日癸未时断.html.vue"]]);export{f as default};
